    for x in range(size):
        cipher = AES.new(current_seed, AES.MODE_OCB)
        string_to_encrypt = initial_string+str(nonce)+str(presets[nonce%16])
        string_to_encrypt = hashlib.sha256(string_to_encrypt.encode()).digest()
